function create() {
	this.finish = false;
    this.minAlphaRatio = 0.13;
	this.tutorialIsActive = true;

    this.bg = game.add.sprite(this.game.world.centerX, this.game.world.centerY, 'bg');
    this.bg.anchor.set(0.5);

    this.mask = game.add.graphics(0,0);
	this.mask.beginFill(0x000000);
	this.mask.drawRoundedRect(this.bg.width*0.05,this.bg.height*0.41,this.bg.width*0.9, this.bg.height*0.32,10);
	this.mask.endFill();

	this.tutorialBg = game.add.sprite(this.bg.width*0.54, this.bg.height*0.3, 'atlas','tutorial.png');
    this.tutorialBg.anchor.set(0.5);
    this.tutorialBg.scale.set(0);
	this.textTutorial = game.add.text(-10,30, "Touch the paint\nto reveal your prize!\nScratch and match to win cash!", this.textStyle);
	this.textTutorial.anchor.set(0.5);
	this.tutorialBg.addChild(this.textTutorial);

 	this.hand = game.add.sprite(this.bg.width*0.65, this.bg.height*0.87, 'atlas','hand.png');
    this.hand.scale.set(0.5);
    this.hand.anchor.set(0.5);
    this.hand.alpha = 0;
    this.handTween = this.game.add.tween(this.hand).to({x:this.bg.width*0.64, y:this.bg.height*0.86}, 1000, Phaser.Easing.Sinusoidal.Out,false,0,-1,true);
    
    this.handTutorial = game.add.sprite(this.bg.width*0.65, this.bg.height*0.65, 'atlas','hand.png');
    this.handTutorial.scale.set(0.3);
    this.handTutorial.anchor.set(0.5);
    this.handTutorial.alpha = 1;
    this.handTween2 = this.game.add.tween(this.handTutorial).to({x:[this.bg.width*0.4,this.bg.width*0.6,this.bg.width*0.5,this.bg.width*0.8,this.bg.width*0.7], y:[this.bg.height*0.5,this.bg.height*0.45,this.bg.height*0.55,this.bg.height*0.6,this.bg.height*0.65]}, 3000, Phaser.Easing.Sinusoidal.Out,false,0,-1,false);
   
    this.button = game.add.sprite(this.bg.width*0.5,  this.bg.height*1.5,'atlas','start.png');
    this.button.scale.set(0.8);
    this.button.anchor.set(0.5);
    this.buttonTween = this.game.add.tween(this.button.scale).to({x:0.9, y:0.9}, 1000, Phaser.Easing.Quadratic.InOut,false,0,-1,true);
    this.button.inputEnabled = true;
	this.button.events.onInputUp.add(onClickStart,this);

    if(this.tutorialIsActive)
    	this.activateTutorial();

    this.conditionWin = game.add.sprite(this.bg.width*0.26, this.bg.height*0.35, 'atlas','condition.png');
    this.conditionWin.scale.set(0);
    this.conditionWin.anchor.set(0.5);

  	this.endCard = game.add.sprite(this.bg.width*0.5,  this.bg.height*0.4,'atlas','endcard.png');
    this.endCard.anchor.set(0.5);
    this.endCard.scale.set(0);
	this.endCardTween = this.game.add.tween(this.endCard.scale).to({ x: 1.1, y: 1.1}, 400, Phaser.Easing.Sinusoidal.In).to({ x: 1, y: 1}, 250, Phaser.Easing.Sinusoidal.Out);

	this.withdraw = game.add.sprite(this.bg.width*0.5,  this.bg.height*1.5,'atlas','withdraw.png');
    this.withdraw.scale.set(0.8);
    this.withdraw.anchor.set(0.5);
    this.withdrawTween = this.game.add.tween(this.withdraw.scale).to({x:0.9, y:0.9}, 1000, Phaser.Easing.Quadratic.InOut,false,0,-1,true);
    this.withdraw.inputEnabled = true;
	this.withdraw.events.onInputUp.add(onClickDownload,this);

	this.grey = game.add.graphics(0,0);
	this.grey.beginFill(0x000000);
	this.grey.drawRect(0,0,this.game.width, this.game.height);
	this.grey.endFill();
	this.grey.alpha = 0;

    this.popUpMsg(this.tutorialBg,0.9,0.9,100,null,null);
	this.game.input.addMoveCallback(this.testAlphaRatio, this);
}

function onClickStart(){
	this.handTutorial.kill();
	this.imageToScratch2.kill();
	this.bg.loadTexture('bg2');

	 createItems();

    this.imageToScratch = game.make.sprite(0, 0, 'atlas','scratchHere.png');
    this.imageToScratch.scale.set(0.9);
    this.imageToScratch.anchor.set(0.5);
    this.brush = game.make.sprite(0, 0, 'brush');
    this.brush.anchor.set(0.5);

 	this.bitmap = new Phaser.BitmapData(game, '', 480, 720);
    this.hide = game.add.sprite(0, 0, this.bitmap);
    this.bitmap.draw(this.imageToScratch,this.game.world.centerX,this.bg.height*0.678);

	this.button.kill();
	this.tutorialBg.kill();
	this.conditionWin.scale.set(0.55);
	this.tutorialIsActive = false;

	this.handTween.stop();
	this.hand.alpha = 0;
	this.hand.x = this.bg.width*0.65; 
	this.hand.y = this.bg.height*0.87;
	this.handTween = this.game.add.tween(this.hand).to({x:this.bg.width*0.63, y:this.bg.height*0.86}, 1000, Phaser.Easing.Sinusoidal.Out,false,0,-1,true);
}

function popUpMsg(obj,scaleX,scaleY,time,finalEvent,eventTime){
	game.time.events.add(time, function() { 
		var tween = game.add.tween(obj.scale).to({ x: scaleX, y: scaleY}, 400, Phaser.Easing.Sinusoidal.In).to({ x: 1, y: 1}, 250, Phaser.Easing.Sinusoidal.Out).start();
		if(finalEvent)
			game.time.events.add(eventTime, finalEvent, this);
	}, this);
}

function move(obj,posx,posy,time,finalEvent,eventTime){
	game.time.events.add(time, function() { 
		var tween = game.add.tween(obj).to({ x: posx, y: posy}, 400, Phaser.Easing.Sinusoidal.InOut).start();
		if(finalEvent)
			game.time.events.add(eventTime, finalEvent, this);
	}, this);
}

function activateTutorial(){
	this.hand.alpha = 1;
	this.handTutorial.alpha = 1;

	this.imageToScratch2 = game.add.sprite(this.bg.width*0.5, this.bg.height*0.5, 'atlas','scratchHereWhite.png');
    this.imageToScratch2.anchor.set(0.5);
	this.imageToScratch3 = game.add.sprite(0, 0, 'atlas','scratchHere.png');
    this.imageToScratch3.anchor.set(0.5);
    this.imageToScratch4 = game.add.sprite(0, -50, 'atlas','tone.png');
    this.imageToScratch4.anchor.set(0.5);
	this.imageToScratch2.addChild(this.imageToScratch3);
	this.imageToScratch2.addChild(this.imageToScratch4);

	this.tutorialBg.bringToTop();
	this.button.bringToTop();
	this.hand.bringToTop();
	this.imageToScratch2.bringToTop();
	this.imageToScratch2.mask = this.mask;
	this.handTutorial.bringToTop();
	this.handTween2.start();
	this.handTween.start();
	this.move(this.button,this.button.x,this.bg.height*0.8,0,function(){this.buttonTween.start();},100);
}

function addItem(x, y,frame) {
    var tile = this.items.create(x * 112, y * 112,'atlas','item_'+frame+'.png');
    tile.anchor.setTo(0.5);
    tile.scale.setTo(0.8);
    return tile;
}

function createItems(){
	this.items = this.game.add.group();
	this.items.x = this.bg.width*0.2;
    this.items.y = this.bg.height*0.5;
    this.frameItem = [
        [6,2,6],
        [5,3,2],
        [3,1,3]
    ];

	for (var i = 0; i < 3; i++) {
        for (var j = 0; j < 3; j++) {
            this.addItem(j,i,this.frameItem[i][j]);
        }
    }
}

function update(){
	if(this.tutorialIsActive) return;

    if (this.game.input.activePointer.isDown){
        var x = this.game.input.activePointer.x;
        var y = this.game.input.activePointer.y;
        this.bitmap.blendDestinationOut();
        this.bitmap.draw(this.brush,x, y,100,100);
        this.bitmap.blendReset();
        this.bitmap.dirty = true;
      } 
}

function alphaRatio (ctx) {
	var alphaPixels = 0;

	var data = ctx.getImageData(0,0, ctx.canvas.width,ctx.canvas.height).data;
	for(var i=3; i<data.length; i+=4) {
	  if(data[i] > 0) alphaPixels++;
	}
	return alphaPixels / (ctx.canvas.width * ctx.canvas.height);
}

function testAlphaRatio(){
	if(this.tutorialIsActive) return;

	if(!this.finish && this.alphaRatio(this.bitmap.ctx) < this.minAlphaRatio){
	      this.finish = true;
	      this.hide.alpha = 0;
	      this.game.time.events.add(1000,function(){
				this.grey.alpha = 0.5;
	      		this.move(this.withdraw,this.withdraw.x,this.bg.height*0.8,0,this.callCTA,100);
	      	this.withdrawTween.start();
	      	this.endCardTween.start();
	      });     
    }
}

function callCTA(){
	this.withdrawTween.start();
	this.withdraw.bringToTop();
	this.endCard.bringToTop();
	this.hand.bringToTop();

	this.confeti = this.game.add.emitter(this.game.world.centerX, -32, 25);
    this.confeti.makeParticles('atlas',['confeti_1.png','confeti_2.png','confeti_3.png','confeti_4.png','confeti_5.png','confeti_6.png','confeti_7.png','confeti_8.png']);
    this.confeti.maxParticleScale = 0.6;
    this.confeti.minParticleScale = 0.2;
    this.confeti.setYSpeed(20, 400);
    this.confeti.gravity = 30;
    this.confeti.width = this.game.world.width * 1.5;
    this.confeti.minRotation = -40;
    this.confeti.maxRotation = 40;

	this.hand.alpha = 1;
	this.handTween.start();
	this.confeti.start(false, 10000, 20,25);
}